  \"2016-04-23T02:37:31.529156\",\n\t\"name\": \"elevationother-dsm1p4m\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"A Digital Surface Model (DSM) represents
  the earth's surface and all objects on it like buildings and tree canopy, was derived
  from the best available LiDAR \"point cloud\" data sources across the state by the
  UVM Spatial Analysis Lab and grouped into three seperate resolutions, i.e., ElevationOther_DSM0p7m;
  ElevationOther_DSM1m & ElevationOther_DSM1p4m. For an overview of the \"Vermont
  LiDAR Initiative\" please see \"VCGI.VERMONT.GOV/LIDAR\". For specific details on
  each project extent's \"point cloud\", e.g., flight dates, nominal pulse spacing
  and RMSEz etc., see the VCGI LiDAR data product page for links to each extents vendor
  based metadata - http://vcgi.vermont.gov/warehouse/products/ALL-LDR_MIX_LIDAR_STATE_ALL.
  Ultimately, each LiDAR dataset extent will be integrated with the multi-resolution
  National Elevation Dataset (NED), at resolutions of approx. 1/27 arc-second (ranging
  from 0.7 to 1.4 meters) and \"Elevation Quality Levels (QL)\" of QL2 and QL3. See
  the \"LiDAR Data Quality Levels (QLs) - Specifications for the varying \"QLs\" link
  under the \"Resources\" section of the VT LiDAR Initiative web page for details
  - \"vcgi.vermont.gov/lidar\" . The NED is the ultimatel repository for the best
  available public domain raster elevation data of the conterminous United States,
  Alaska, Hawaii, and territorial islands in a seamless format from diverse source
  data and processed to a common coordinate system and unit of vertical measure.\",\n\t\"license_title\":
